"use scrict";NodeList.prototype.forEach=Array.prototype.forEach,document.querySelectorAll(".ssk-table").forEach(e=>{if(console.log(e.rows[0].cells[0].tagName),"TH"==e.rows[0].cells[0].tagName){let t=[];for(let o,l=0;o=e.rows[0].cells[l];l++)t.push((o.innerText||o.textContent).trim());for(let o,l=1;o=e.rows[l];l++)for(let e,l=0;e=o.cells[l];l++)e.setAttribute("data-label",t[l])}});